public int compare(SubclusterAvailableSpace cluster1,
    SubclusterAvailableSpace cluster2) {
  int ret = cluster1.getAvailableSpace() > cluster2.getAvailableSpace() ? -1
      : 1;

  if (ret < 0) {
    return (RAND.nextInt(100) < balancedPreference) ? -1 : 1;
  } else {
    return (RAND.nextInt(100) < balancedPreference) ? 1 : -1;
  }
}
